### JavaScript

```javascript
"use strict";

function f_gold(s) {
    function convert(i, j) {
        let res = [];
        for (let k = 1; k <= j - i; k++) {
            let left = s.slice(i, i + k);
            let right = s.slice(i + k, j);
            let valid = (left === '0' || !left.startsWith('0')) && !right.endsWith('0');
            if (valid) {
                res.push(left + (k < j - i ? '.' : '') + right);
            }
        }
        return res;
    }
    let n = s.length;
    let ans = [];
    for (let i = 2; i < n - 1; i++) {
        for (let x of convert(1, i)) {
            for (let y of convert(i, n - 1)) {
                ans.push(`(${x}, ${y})`);
            }
        }
    }
    return ans;
}
```
